const Kitoko={init:()=>{document.addEventListener("click",t=>{const o=t.target.closest("[data-kitoko]");if(!o)return;const e=o.dataset.kitoko,i=o.dataset.target,n=document.querySelector(i);if(n){if("toggle"===e&&n.classList.toggle("k-d-none"),"burger"===e){n.classList.toggle("k-active");const t=n.classList.contains("k-active");o.setAttribute("aria-expanded",t)}}else console.warn(`Kitoko: Target "${i}" not found for action "${e}".`)}),console.log("Kitoko Framework v1.0.0 initialized ðŸš€")}};window.Kitoko=Kitoko,document.addEventListener("DOMContentLoaded",Kitoko.init);